import React, { useState } from "react";

const About = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [modalContent, setModalContent] = useState("");

  const openModal = (content) => {
    setModalContent(content);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setModalContent("");
  };

  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "flex-start",
        padding: "140px",
        maxWidth: "1390px",
      }}
    >
      {/* Content Section */}
      <div style={{ marginLeft: "80px", flex: 1 }}>
        <div
          style={{
            display: "flex",
            marginTop: "40px",
            gap: "20px",
          }}
        >
          {/* Left Content */}
          <div style={{ flex: "1" }}>
            {/* Our Vision */}
            <h3
              style={{
                fontSize: "30px",
                fontWeight: "bold",
                color: "#F09319",
                marginTop: "100px",
                marginLeft: "-450px",
              }}
            >
              Our Vision
            </h3>
            <p
              style={{
                fontSize: "16px",
                color: "#555",
                marginBottom: "50px",
                marginLeft: "-650px",
                alignItems: "center",
              }}
            >
              To facilitate economic growth and enhance the financial ecosystem while equipping <br />
              stakeholders with essential skills for development.
            </p>
            <button
              onClick={() =>
                openModal(
                  "Facilitating Economic Growth:\n\nInvestment in Infrastructure: Build and improve physical infrastructure (e.g., roads, energy) to enhance productivity and economic activity.\n\nEnhancing the Financial Ecosystem:\n\nAccess to Credit: Ensure individuals and businesses have fair access to credit for growth and development."
                )
              }
              style={{
                marginTop: "10px",
                marginLeft: "-650px",
                padding: "10px 20px",
                fontSize: "16px",
                backgroundColor: "#F09319",
                color: "#fff",
                border: "none",
                borderRadius: "5px",
                cursor: "pointer",
              }}
            >
              Learn More
            </button>

            {/* Our Mission */}
            <h3
              style={{
                fontSize: "30px",
                fontWeight: "bold",
                color: "#F09319",
                marginTop: "200px",
                marginLeft: "-450px",
              }}
            >
              Our Mission
            </h3>
            <p
              style={{
                fontSize: "16px",
                color: "#555",
                marginTop: "50px",
                marginLeft: "-650px",
                alignItems: "center",
              }}
            >
              To serve as a conduit between the government and beneficiaries, addressing key <br />
              economic issues, policies, and regulations through collaboration with stakeholders.
            </p>
            <button
              onClick={() =>
                openModal(
                  "Equipping Stakeholders:\n\nTraining and Resources: Provide necessary financial literacy and support programs to stakeholders."
                )
              }
              style={{
                marginTop: "10px",
                marginLeft: "-650px",
                padding: "10px 20px",
                fontSize: "16px",
                backgroundColor: "green",
                color: "#fff",
                border: "none",
                borderRadius: "5px",
                cursor: "pointer",
              }}
            >
              Learn More
            </button>
          </div>
        </div>
      </div>

      {/* Modal */}
      {isModalOpen && (
        <div
          style={{
            position: "fixed",
            top: 0,
            left: 0,
            width: "100%",
            height: "100%",
            backgroundColor: "rgba(0, 0, 0, 0.5)",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div
            style={{
              width: "600px",
              backgroundColor: "#fff",
              borderRadius: "10px",
              padding: "20px",
              textAlign: "center",
              position: "relative",
            }}
          >
            <button
              onClick={closeModal}
              style={{
                position: "absolute",
                top: "10px",
                right: "10px",
                backgroundColor: "red",
                color: "#fff",
                border: "none",
                borderRadius: "50%",
                width: "30px",
                height: "30px",
                cursor: "pointer",
              }}
            >
              X
            </button>
            <img
              src="/images/modalImage.jpg"
              alt="Modal Visual"
              style={{
                width: "100%",
                height: "200px",
                objectFit: "cover",
                borderRadius: "10px",
                marginBottom: "20px",
              }}
            />
            <h3 style={{ fontSize: "24px", fontWeight: "bold", color: "#333" }}>
              Modal Heading
            </h3>
            <p style={{ fontSize: "16px", color: "#555", whiteSpace: "pre-wrap" }}>
              {modalContent}
            </p>
          </div>
        </div>
      )}
    </div>
  );
};

export default About;
